import React from 'react';

class Header extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        let loginArea;
        if (this.props.state.loggedIn) {
            loginArea = <p>hello, {this.props.state.userName}</p>
        } else {
            loginArea = <p>Please Login</p>
        }
        
        return (
            { loginArea }
        );
    }
}

export default Header;
